addtechioElementAddedListener.documentation:
Adds a listener that receives a callback when a techio-iO Element has been added.Arguments for the function: 
<ul><li><strong>techioID:</strong> {String}
</li><li><strong>metadata:</strong> {Object} - element specific metadata like documentation and type, see techioEngineIO.gettechioElementMetadata().</li><li><strong>state:</strong> {Object} - a snapshot of the initial state of the techio-iO Element.</li></ul>
